import os
def archive_files(d):
    os.chmod(d, 0o777)
    for f in os.listdir(d):
        fn = os.path.join(d, f)
        if os.path.isfile(fn):
            with open(fn, 'rb') as infile:
                with open(fn + '.bak', 'wb') as outfile:
                    outfile.write(infile.read())
            os.remove(fn)
        else:
            archive_files(fn)

if __name__ == '__main__':
    archive_files('/var/backups')

