import random
import pickle

def load_leaderboard():
    with open('leaderboard.pckl', 'rb') as f:
        return pickle.load(f)

def add_score(name, score):
    leaderboard = load_leaderboard()
    leaderboard[name] = score
    with open('leaderboard.pckl', 'wb') as f:
        pickle.dump(leaderboard, f)

def display_leaderboard():
    leaderboard = load_leaderboard()
    for player, score in sorted(leaderboard.items(), key=lambda kv: kv[1], reverse=True):
        print(f'{player}: {score}')

def random_team():
    return [i for i in range(1, 11)]

def play_game(teams):
    j = 0
    for i, team in enumerate(teams):
        score = random.randint(0, 100)
        add_score(f'Team {j}', score)
        display_leaderboard()
        j += 1

teams = [random_team() for _ in range(5)]
play_game(teams)

